/*
 *  Add the Experian NumEmployees Value
 *
 */
DECLARE @UserID int = -1
DECLARE @Start DateTime = GETDATE()


-- ="INSERT INTO @MyTable VALUES (" & A2 & ", '" & B2 & "', '" & K2 & "');"
DECLARE @MyTable table (
	BBID int,
	BIN varchar(15),
	EmployeeCode varchar(40)
)




-- Step 1: Add any new records to the PRCompany Experian table.
SELECT BBID, BIN, @Start, @UserID, @Start, @UserID
	FROM @MyTable
	WHERE BBID NOT IN (SELECT prcex_CompanyID FROM PRCompanyExperian)

-- Step 2: Update the Employee Count translating the Experian code to the CRM code.
UPDATE PRCompanyExperian
	SET prcex_BIN = BIN,
	    prcex_Employees = CASE EmployeeCode WHEN 'A' THEN '1' WHEN 'B' THEN '2' WHEN 'C' THEN '3' WHEN 'D' THEN '4' WHEN 'E' THEN '5'  WHEN 'F' THEN '6'  WHEN 'G' THEN '7'  WHEN 'H' THEN '8'  WHEN 'I' THEN '9' END,
		prcex_UpdatedDate = @Start,
		prcex_UpdatedBy = @UserID
	FROM @MyTable
	WHERE prcex_CompanyID = BBID
Go

