-- Cleanup transactions for Lumber records that are of explanation "listing online only"
DELETE t
FROM PRTransaction t
		INNER JOIN Company on comp_companyid = prtx_companyid
		INNER JOIN vPRLocation ON comp_PRListingCityID = prci_CityID
WHERE CAST(prtx_Explanation AS varchar(1000))='Listing online only'
		AND comp_PRIndustryType = 'L'
